import React from "react";
import Grid from "@material-ui/core/Grid";
import { ShowOtherwiseProperty } from "./BooleanProperties";
import { OtherwiseLabelProperty, OtherwiseTooltipProperty } from "./TextProperties";
import { MinProperty, MaxProperty, StepProperty } from "./NumericProperties";
import { makeStyles } from "@material-ui/core";

// not in use yet
export const DataMethodProperty = ({ ...props }) => {
  return null;
};
export const ExpandableContentProperty = ({ ...props }) => null;

// Composite properties. These consists of smaller properties, depending on each other:
export const OtherwiseProperty = ({ newQuestion, newQuestionDispatch }) => {
  return (
    <>
      <ShowOtherwiseProperty
        newQuestion={newQuestion}
        newQuestionDispatch={newQuestionDispatch}
      />
      {newQuestion.show_otherwise ? (
        <Grid item xs style={{ textAlign: "center", margin: "1em 0" }}>
          <OtherwiseLabelProperty
            newQuestion={newQuestion}
            newQuestionDispatch={newQuestionDispatch}
          />
          <OtherwiseTooltipProperty
            newQuestion={newQuestion}
            newQuestionDispatch={newQuestionDispatch}
          />
        </Grid>
      ) : null}
    </>
  );
};

export const DefaultDateCompositionProperty = ({
  newQuestion,
  newQuestionDispatch,
}) => {};

export const CustomMinMaxStepProperty = () => {
  const classes = useStyles();
  return (
    <Grid container direction="row" justify="space-between" alignItems="center" spacing={1}>
      <Grid item xs={4}>
        <MaxProperty />
      </Grid>
      <Grid item xs={4}>
        <MinProperty />
      </Grid>
      <Grid item xs={4}>
        <StepProperty />
      </Grid>
    </Grid>
  );
};
